-- Copiando estrutura do banco de dados para starwars
CREATE DATABASE IF NOT EXISTS `starwars` /*!40100 DEFAULT CHARACTER SET utf8 */;
USE `starwars`;

-- Copiando estrutura para tabela starwars.characters
CREATE TABLE IF NOT EXISTS `characters` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) DEFAULT NULL,
  `description` longtext,
  `force` varchar(255) DEFAULT NULL,
  `img` longtext,
  `star` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8;

-- Copiando dados para a tabela starwars.characters: ~8 rows (aproximadamente)
/*!40000 ALTER TABLE `characters` DISABLE KEYS */;
INSERT INTO `characters` (`id`, `name`, `description`, `force`, `img`, `star`) VALUES
	(1, 'Luke Skywalker', '\nLuke Skywalker was a Force-sensitive human and a Jedi Master who, along with his twin sister, Princess Leia Organa, fought against the government of the Galactic Empire during the Galactic Civil War. Son of Jedi Knight Anakin Skywalker and Senator Padmé Amidala of Naboo, Luke was born shortly after the end of the Clone Wars in 19 BBY. As a result of his mother\'s death and his father\'s fall to the dark side of the Force, Luke was sent to Anakin\'s home planet, Tatooine, to live with his relatives, Owen and Beru Lars, during the first 19 years of his life. After their deaths at the hands of the Empire, Luke became an apprentice to his father\'s former teacher, Obi-Wan Kenobi, in order to learn the ways of the Force and become a Jedi. With the help of smugglers Han Solo and Chewbacca, Skywalker rescued Leia Organa from the grip of the Empire, but lost her master, who died while confronting the Sith Lord Darth Vader. At the Battle of Yavin, Skywalker managed to destroy the battle station and superweapon of the Empire, the Death Star, thus saving the Alliance to Restore the Republic from destruction.', 'Light', 'data:image/jpeg;base64,', 5),
	(2, 'Stormtroopers ', 'The stormtroopers were the assault troops of the Galactic Empire. Citizens referred to them as Cube Heads, a derogatory nickname inspired by the assault soldiers\' bucket-shaped helmets. As members of the Assault Soldier Corps, an independent branch operating under the Imperial Army, the stormtroopers represented the backbone of the Imperial-trained Armed Forces for full obedience to the hierarchical command, as well as absolute loyalty to the Emperor Sheev Palpatine. and the Imperial regime. The stormtroopers were trained at Imperial Academies, and used a variety of weapons ...', 'Dark', 'data:image/jpeg;base64,', 3),
	(3, 'Han Solo', 'Han Solo, formerly known as Han before an Imperial Recruitment Officer gave him the surname Solo, was a human smuggler who became a leader in the Alliance to Restore the Republic and an instrumental figure in the defeat of the Galactic Empire during the Galactic Civil War. He came from Corellia and became a smuggler in the service of Jabba the Hutt, even completing the Kessel Corridor in less than thirteen parsecs with his precious ship, the Millennium Falcon. He was the son-in-law of fallen Jedi Knight Anakin Skywalker and Senator Padmé Amidala, husband of Princess Leia Organa, brother-in-law of Jedi Master Luke Skywalker, father of Ben Solo, rivals and close friends of his smuggler Lando Calrissian and best friends of Wookie Chewbacca, his trusted co-pilot who swore a life debt to the Corellian smuggler. He only came into conflict with Jabba after disposing of a shipment of spices to avoid problems with the Empire, which caused the Hutt a large amount of money as a result. His fortune seemed to have changed when he agreed to hire Luke Skywalker, Obi-Wan Kenobi, and the R2-D2 and C-3PO droids to Alderaan, but he got caught up in the rebellion against the Empire and, after helping Leia Organa escape. the Death Star, fought briefly in the Battle of Yavin, which allowed Skywalker to destroy the superweapon. He only fought with the Rebellion for several years after, participating in numerous operations and battles against the Empire.', 'Light', 'data:image/jpeg;base64,', 3),
	(4, 'Boba Fett', 'Boba Fett was a human bounty hunter, and the clone of the infamous bounty hunter Jango Fett. Boba was created by the Kamino cloners and was physically identical to the clone troopers created for the Grand Army of the Republic, although Boba was unaltered and did not grow rapidly like the other clones. Raised as Jango\'s son, Boba learned the combat skills necessary to one day become a bounty hunter in his own right.', 'Dark', 'data:image/jpeg;base64,', 3),
	(5, 'Darth Vader', '\nAnakin Skywalker was a Force-sensitive human who served the Galactic Republic as a Jedi Knight and later the Galactic Empire as the Sith Lord Darth Vader. Believed to have been conceived by the Force, he was born to Shmi Skywalker and went on to reside on the planet of Outer Rim Tatooine as a child, where he and his mother were slaves of the prominent crime mistress Gardulla the Hutt until they became property from a local Toydarian junkyard called Watto. A prodigious engineer, Skywalker built the C-3PO protocol droid using pieces he had collected to help his mother. Shortly thereafter, during the Naboo Crisis, he was discovered by Jedi Master Qui-Gon Jinn and his apprentice, Obi-Wan Kenobi, who freed him from slavery after participating Skywalker in a successful pod race. Taking him before the Jedi Order, Jinn introduced Skywalker as the Chosen One of the Jedi Prophecy, destined to destroy the Sith and bring balance to the Force.', 'Dark', 'data:image/jpeg;base64,', 6);
INSERT INTO `characters` (`id`, `name`, `description`, `force`, `img`, `star`) VALUES
	(6, 'Yoda', '\nYoda, a male member of a mysterious species, was a revered Jedi Master who served as Grand Master of the Jedi Order in the last days of the Galactic Republic. He was famous within the Order for his wisdom, powers of the Force and combat with lightsabers, and he lived for almost 900 years. His time during the last days of the Jedi Order and beyond made him a consistent figure in galactic history.', 'Light', 'data:image/jpeg;base64,', 3),
	(7, 'C-3PO', 'C-3PO, sometimes spelled Threepio and often referred to simply as Trespeó, was a 3PO unit protocol droid designed to interact with organic beings, programmed primarily for etiquette and protocol. He spoke fluently more than seven million forms of communication, and developed a demanding and prone to worry throughout his many decades of operation. Along with its counterpart, the astromech droid R2-D2, C-3PO constantly found itself directly involved in crucial moments of galactic history, and helped save the galaxy on many occasions. C-3PO was rebuilt from spare parts by Anakin Skywalker, a human slave who lived in Mos Espa, a city in the Outer Rim world of Tatooine. The memory of C-3PO was erased, although the memory of R2-D2 was not. C-3PO and R2-D2 were assigned to the Alderaan Tantive IV cruise, where they served Senator Bail Organa for nineteen years. At some point during this time, 3PO\'s right leg was equipped with that of another droid.', 'Light', 'data:image/jpeg;base64,', 2),
	(8, 'R2-D2', 'R2-D2, pronounced Artoo Dedos and often referred to as Artoo, was an astromech droid of the R2 series manufactured by Industrias Automaton that had a male programming. He was an intelligent and brave droid who served a multitude of teachers throughout his life, and never received a complete memory erasure (apart from a partial mental erasure by Cad Bane during the Senate hostage crisis) nor has he received programming new, with these factors I developed an adventurous and independent attitude. He was often at crucial moments in galactic history, and his bravery and ingenuity often saved the galaxy over and over again.', 'Light', 'data:image/jpeg;base64,', 3),
	(9, 'Chewbacca', '\nChewbacca, affectionately called Chewie by his friends, was a Wookiee warrior, a smuggler and a resistance fighter who fought in the Clone Wars, the Galactic Civil War and the First Order-Resistance Conflict. He was raised on the planet Kashyyyk and became a military leader. During the Clone Wars, he was captured by Trandoshan slavers and taken prisoner in Wasskah, where he worked with another captive, the Jedi Commander Ahsoka Tano, to escape. He later commanded the wokie forces during the Battle of Kashyyyk with the Grand Army of the Republic, led by Jedi Master Yoda. During the battle, one of the last of the war, Yoda\'s clone troopers received Order 66 from Supreme Chancellor Sheev Palpatine and, with the help of Chewbacca, Yoda escaped from Kashyyyk and the destruction of the Jedi Order.', 'Light', 'data:image/jpeg;base64,', 2);
INSERT INTO `characters` (`id`, `name`, `description`, `force`, `img`, `star`) VALUES
	(10, 'Darth Maul', '\nDarth Maul was a dathomirian zabrak and Lord Sith who lived during the last years of the Galactic Republic. Maul was born of the mother Talzin and was raised as a Brother of the Night in Dathomir, before being taken by Darth Sidious as his apprentice. Maul learned the art of combat with lightsabers and took a double blade of lightsaber as a personal lightsaber, becoming a weapon to be used against the Jedi Order.', 'Dark', 'data:image/jpeg;base64,', 4);
